  false,\n\t\"url\": null,\n\t\"notes\": \"BROADBAND_COVERAGE_WIRELINE_WIRELESS_IN
  is a polygon feature class that contains broadband WIRELESS and WIRELINE coverage
  areas in Indiana, and was provided by personnel of the Indiana Office of Technology
  (IOT) and 39 Degrees North. The term \"WIRELESS\" includes the following techologies:
  Terrestrial Fixed Wireless - Unlicensed, Terrestrial Fixed Wireless - Licensed,
  and Terrestrial Mobile Wireless. The term \"WIRELINE\" includes the following techologies:
  AxDSL, DSL, Cable, and Fiber. The data set provided by IOT was in an ESRI geodatabase
  format and was named \"BROADBAND_INDIANAMAP_UPDATE_SPRING2013.GDB.\"\",\n\t\"license_title\":
